*/

const core = require('../../caver-core')
const Method = require('../../caver-core-method')

const Net = function Net(...args) {
    const _this = this

    core.packageInit(this, args)

    const netMethods = [
        new Method({
            name: 'getNetworkId',
            call: 'net_networkID',
            params: 0,
        }),
        new Method({
            name: 'isListening',
            call: 'net_listening',
            params: 0,
        }),
        new Method({
            name: 'getPeerCount',
            call: 'net_peerCount',
            params: 0,
        }),
        new Method({
            name: 'getPeerCountByType',
            call: 'net_peerCountByType',
            params: 0,
        }),
    ]

    netMethods.forEach(function(method) {
        method.attachToObject(_this)
        method.setRequestManager(_this._requestManager)
    })
}

module.exports = Net
